import React from 'react';
const Sidebar = () => (
  <div className="bg-white dark:bg-gray-800 w-64 p-4 shadow-md text-gray-900 dark:text-white">
    <ul className="space-y-4">
      <li className="font-semibold text-blue-600 dark:text-blue-400">Dashboard</li>
      <li>Portfolio</li><li>Orders</li><li>Watchlist</li>
    </ul>
  </div>);
export default Sidebar;
